import React from "react";
import human from "../../../Image/human.jpg";
import human2 from "../../../Image/human2.jpg";
import "./NavTop.css";
import List from "../List/List";

const NavTop = () => {
  return (
    <div className="navtop">
      <div className="row in-profile">
        <div className="col ">
          <img src={human} alt="" width="65" className="rounded-circle" />
          <button type="button" class="btn btn-primary" data-toggle="modal" data-target="#exampleModal">
  Launch demo modal
</button>
          <i className="fa fa-bars icon float-right" ></i>
        </div>
      </div>
    </div>
  );
};

export default NavTop;
